function BehaviourFinance(props) {
  return(
    <div>
      <Title level={3}>行为金融学</Title>
      <br/>
      <p>
        行为金融学是在行为经济学理论基础上发展出的重要分支学科，它对传统主流金融学思想体系中的理性假设提出质疑，认为现实的市场行为中存在一定的非理性因素。
        当以理性人假设和EMH理论为核心的传统金融学遇上无法解释的市场异象时，将人的心理因素纳入考量体系的行为金融学理论由此诞生。
      </p>
      <p>
        行为金融理论从投资者的现实投资方式和决定心理因素着手，分析投资者的现实投资决策对金融资产价值的影响。
        它系统分析了人们的偏好与情感对投资行为、资产价格和资本市场变化的深远影响，是将行为认知理论与金融学思想相结合的产物。
      </p>
      <p>
        行为金融理论认为股票的价格会受到投资主体行为的影响。
        某一时期，如果投资者情绪高涨，表现为高估企业预期收益，低估相应的风险，从而导致抬高股价，偏离基本价格，从而很可能获得较好的收益率。
      </p>
      <p>
        西方行为金融理论的研究对象侧重于关注资本市场中的“异象”，如羊群效应、反应不足、反应过度等。
        以及投资者在做投资决策时所存在的心理偏差及偏好，包括心理账户、羊群行为等非理性信息和损失规避、自我归因等心理，它们影响着人们的理性决策。
        如因心理账户的存在，人们对金融投资产品的价值评估存在差异，导致非理性的投资行为。
      </p>
    </div>
  );
}
function LocalPreferences(props) {
  return(
    <div>
      <Title level={3}>本地偏好</Title>
      <br/>
      <p>
        投资者在选择股票时往往会倾向于购买本地公司的股票，即投资者存在本地偏好行为．本地偏好现象最先在跨国金融市场上被发现，投资者将大部分资金用于配置本国市场股票，之后也被拓展到国内金融市场中，投资者会偏向购买本地公司的股票．投资者基于对本地公司股票的熟悉感和过度自信产生非理性行为偏差而选择购买本地上市公司股票。
      </p>
      <p>
        社会心理学认为，人们很容易对自己身边的事物产生熟悉感和喜爱感，进而对这些事物倾注更多的关注和偏好，这是社会中的个体所普遍存在的心理现象。
        这种心理现象在股票市场的突出表现就是，投资者往往会更多地关注并且配置本地公司的股票。越来越多的学者发现在跨国市场中，投资者并没有选择分散化和多元化的国际投资组合，
        而是将资产更多地配置本国市场的股票。投资者本地偏好现象在中国市场也普遍存在。
        特别是我国的投资群体主要由散户投资者构成，散户易出现非理性行为偏差。
        散户投资者关注上市公司主要通过主动搜索，但其关注度分配存在本地偏差，且这种偏差在在欠发达地区更加明显。
        不同城市的经济发展水平、上市公司稀缺性和知名度以及投资者金融素养等方面都有一定程度的影响，可能因此存在差异。
        现阶段对本地偏好的研究，主要集中在验证不同市场参与主体是否存在本地偏好倾向、本地偏好对股票交易活动的影响等内容方面。
      </p>
      <p style={{float:'right'}}>———《投资者本地偏好对股票市场信息效率影响研究》</p>
      <Divider/>
      <p>
        Huang等（Local bias in investor attention: Evidence from China’s Internet stock message boards[J] . Yuqin Huang,Huiyan Qiu,Zhiguo Wu.  Journal of Empirical Finance . 2016）以中国市场为研究对象，研究发现中国投资者在关注度的配置上存在本地偏差倾向，并且这种偏差在欠发达区域、小规模企业、非沪深300指数、低周转率和名称中包含其所在地名的股票中表现的更加强烈。
      </p>
      <p>
        杨晓兰等（本地偏好、投资者情绪与股票收益率:来自网络论坛的经验证据[J]. 杨晓兰,沈翰彬,祝宇.  金融研究. 2016(12)）基于股吧论坛数据构建本地偏好指标，通过实证研究得出投资者本地偏好会对股票收益率和成交量产生显著影响.
      </p>
    </div>
  );
}
function LSTM(props) {
  return(
    <div>
      <Title level={3}>LSTM</Title>
      <p>
        LSTM的“记忆”被称作细胞/cells，其输入为前状态h<sub>t-1</sub>和当前输入x<sub>t</sub>，
        细胞会决定哪些之前的状态和信息需要被保留，哪些被抹去。这种方式可以有效地保留很长时间之前的关联信息。
        从而避免长期依赖问题，实现只保留相关信息而忘记不相关的数据。
        具体结构如图所示:
      </p>
      <div 
        style={{
          position: 'relative',
          left: '50%',
          marginLeft: -250
        }}>
        <Image
          width={500}
          src="data:image/png;base64,"
        />
      </div><br/>
      
      <p>
        重复的模块中包含四个交互层，分别为三个Sigmoid和一个tanh层。图中&sigma;表示的激活函数将值压缩至0-1之间。
        当为0时代表忘记，数据会被剔除；为1时代表记住，信息会完整地保留。
        LSTM的“门”结构由sigmoid神经网络层和pointwise乘法的非线性操作组成，包括记忆细胞、输入门、输出门、遗忘门。
        0代表不允许任何量通过，1代表允许任意量通过，从而使得门结构能够去除或增加信息到细胞状态。
      </p><br/>
      <div><Title level={5}>遗忘门</Title>
        <p>LSTM通过遗忘门的结构从细胞中丢弃信息。</p>
        <p>
          遗忘门读取上一个输出h<sub>t-1</sub>和当前输入x<sub>t</sub>，通过Sigmoid非线性映射，
          输出向量f<sub>t</sub>（该向量的每一个维度的值都在0到1之间），最后与细胞状态C<sub>t-1</sub>相乘。
        </p>
        <div 
          style={{
            position: 'relative',
            left: '50%',
            marginLeft: -250
          }}>
          <Image
            width={500}
            src="data:image/png;base64,"
          />
        </div><br/>
        
        {/* <p>
          f<sub>t</sub> = &sigma;( W<sub>f</sub> · [ h<sub>t-1</sub>, x<sub>t</sub> ] + b<sub>f</sub> ) 
          = &sigma;( W<sub>fh</sub>h<sub>t-1</sub> + W<sub>fx</sub>x<sub>t</sub> + b<sub>f</sub> ) 
        </p> */}
      </div><Divider/>
      <div><Title level={5}>输入门</Title>
        <p>LSTM通过输入门决定哪些新信息被存放在细胞状态中。</p>
        <p>
          分为两部分：Sigmoid层决定哪些值将被更新；tanh层创建新的候选值向量{Ctildet()}并加入状态中。
        </p>
        <div 
          style={{
            position: 'relative',
            left: '50%',
            marginLeft: -250
          }}>
          <Image
            width={500}
            src="data:image/png;base64,"
          />
        </div><br/>
        
        {/* <p>
          i<sub>t</sub> = &sigma;( W<sub>i</sub> · [ h<sub>t-1</sub>, x<sub>t</sub> ] + b<sub>i</sub> ) 
          = &sigma;( W<sub>ih</sub>h<sub>t-1</sub> + W<sub>ix</sub>x<sub>t</sub> + b<sub>i</sub> ) 
          <br/>
          {Ctildet()} = tanh( W<sub>C</sub> · [ h<sub>t-1</sub>, x<sub>t</sub> ] + b<sub>C</sub> ) 
          = tanh( W<sub>Ch</sub>h<sub>t-1</sub> + W<sub>Cx</sub>x<sub>t</sub> + b<sub>C</sub> ) 
        </p> */}
      </div><Divider/>
      <div><Title level={5}>细胞状态</Title>
        <p>
          将细胞状态由C<sub>t-1</sub>更新为C<sub>t</sub>。
        </p>
        <p>
          在遗忘门中我们决定了哪些信息需要被丢弃，在输入门中决定了要加入的新信息，
          于是我们把旧状态与遗忘门得到的f<sub>t</sub>相乘，接着加上输入门得到的i<sub>t</sub>*{Ctildet()}，
          得到了新的候选值，根据我们决定更新每个状态的程度进行变化。
        </p>
        <div 
          style={{
            position: 'relative',
            left: '50%',
            marginLeft: -250
          }}>
          <Image
            width={500}
            src="data:image/png;base64,"
          />
        </div><br/>
        {/* <p>
          C<sub>t</sub> = f<sub>t</sub> * C<sub>t-1</sub> + i<sub>t</sub> * {Ctildet()}
        </p> */}
      </div><Divider/>
      <div><Title level={5}>输出门</Title>
        <p>
          最终，我们需要确定输出什么值。这个输出将会基于细胞状态，但是也是一个过滤后的版本。
          首先，我们运行一个sigmoid层来确定细胞状态的哪个部分将输出出去。
          接着，我们把细胞状态通过tanh进行处理（得到一个在-1到1之间的值）并将它和sigmoid门的输出相乘，最终我们仅仅会输出我们确定输出的那部分。
        </p>
        <div 
          style={{
            position: 'relative',
            left: '50%',
            marginLeft: -250
          }}>
          <Image
            width={500}
            src="data:image/png;base64,"
          />
        </div><br/>
        {/* <p>
          o<sub>t</sub> = &sigma;( W<sub>o</sub> · [ h<sub>t-1</sub>, x<sub>t</sub> ] + b<sub>o</sub> ) 
          = &sigma;( W<sub>oh</sub>h<sub>t-1</sub> + W<sub>ox</sub>x<sub>t</sub> + b<sub>o</sub> ) 
          <br/>
          h<sub>t</sub> = o<sub>t</sub> * tanh( C<sub>t</sub> )
        </p> */}
      </div><Divider/>
    </div>
  );
}
